content.css:
.dashboard-container {
  display: flex;
}
.dashboard-menu {
  flex: 0 0 25%;
}
.dashboard-content {
  flex: 1;
}
.dashboard-content h2 {
  margin-top: 0;
  padding: 0 0 0 2em;
}
.toolbar {
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1em;
}
.toolbar .toolbar-item {
  display: flex;
  margin-left: 0.5em;
}
.goal .goal-trigger {
  color: #fff;
  padding: 1em;
  font-size: 12px;
  font-weight: bold;
  border-radius: 5px;
  margin-bottom: 1em;
}
.goal.open .goal-content {
  display: block;
}
.goal .goal-content {
  display: none;
  padding: 0 1em 0.3em 1em;
  font-size: 10px;
}
.goal .goal-content .subgoal .subgoal-trigger {
  font-weight: bold;
  border-bottom: 1px solid #ccc;
  padding: 1em 0;
}
.goal .goal-content .subgoal.open .indicators {
  display: block;
}
.goal .goal-content .subgoal .indicators {
  font-size: 9px;
  display: none;
}
.goal .goal-content .subgoal .indicators .indicator {
  padding: 0.5em 0.5em 0.5em 1em;
}
.goal .goal-content .subgoal .indicators .indicator.selected {
  background-color: #333;
  color: #fff;
  border-radius: 5px;
}
